import React, { Component } from "react";
import { Grid, Row, Col, Table } from "react-bootstrap";

import Card from "components/Card/Card.jsx";
import { thArray, tdArray } from "variables/Variables.jsx";

class lafargeLocator extends Component {
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="Locate Distance"
                category="Positions"
                ctTableFullWidth
                ctTableResponsive
                content={
<div></div>
                }
              />
            </Col>
          </Row>

          <Row>
            <Col md={12}>
              <Card
                title="Positions"
                category="Positions"
                ctTableFullWidth
                ctTableResponsive
                content={
<div></div>
                }
              />
            </Col>
          </Row>

          <Row>
            <Col md={12}>
              <Card
                title="Positions"
                category="Positions"
                ctTableFullWidth
                ctTableResponsive
                content={
<div></div>
                }
              />
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default lafargeLocator;
